function SidBar(){
    return(
        <>
        <ul className="list-unstyled">
            <li>  <Link  to="/Prodacts">Get All Prodact  </Link></li>
            <li><Link to="/Cateogiers">Get All Cateogiers  </Link> </li>
        </ul>
        </>
    )
}
export default SidBar
